import React from "react";
import { Link } from "react-router-dom";

const AdminDashboard = () => {
  const styles = {
    container: {
      display: "flex",
      minHeight: "100vh",
      fontFamily: "Arial, sans-serif",
      backgroundColor: "#f0f4f7",
    },
    sidebar: {
      width: "250px",
      backgroundColor: "#2c3e50",
      color: "#ecf0f1",
      padding: "20px",
    },
    sidebarTitle: {
      fontSize: "24px",
      fontWeight: "bold",
      textAlign: "center",
      marginBottom: "20px",
    },
    sidebarLink: {
      color: "#ecf0f1",
      textDecoration: "none",
      display: "block",
      padding: "10px 15px",
      borderRadius: "5px",
      transition: "background-color 0.3s ease",
    },
    sidebarLinkHover: {
      backgroundColor: "#34495e",
    },
    header: {
      backgroundColor: "#007BFF",
      color: "#fff",
      padding: "15px",
      borderRadius: "5px",
      marginBottom: "20px",
      textAlign: "center",
    },
    card: {
      backgroundColor: "#007BFF",
      color: "#fff",
      padding: "20px",
      borderRadius: "10px",
      textAlign: "center",
      transition: "transform 0.3s, box-shadow 0.3s",
      boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    },
    cardHover: {
      transform: "translateY(-5px)",
      boxShadow: "0 6px 12px rgba(0, 0, 0, 0.2)",
    },
    cardLink: {
      color: "#fff",
      textDecoration: "none",
      fontWeight: "bold",
      padding: "8px 15px",
      border: "1px solid #fff",
      borderRadius: "5px",
      display: "inline-block",
      transition: "background-color 0.3s ease, border-color 0.3s ease",
    },
    cardLinkHover: {
      backgroundColor: "#0056b3",
    },
  };

  return (
    <div style={styles.container}>
      {/* Sidebar */}
      <div style={styles.sidebar}>
        <h2 style={styles.sidebarTitle}>ADMIN</h2>
        <ul className="list-unstyled">
          {[
            { to: "/", label: "Dashboard" },
            { to: "/StudentDetails", label: "StudentDetails" },
            { to: "/StudentRegistration", label: "StudentRegistration" },
            { to: "/MarkView", label: "MarkView" },
            { to: "/station-registration", label: "Station Master Registration" },
            { to: "/station-list", label: "Station Master List" },
            { to: "/report", label: "Report" },
            { to: "/logout", label: "Logout" },
          ].map((item, index) => (
            <li key={index} className="mb-2">
              <Link
                to={item.to}
                style={styles.sidebarLink}
                onMouseEnter={(e) => (e.target.style.backgroundColor = "#34495e")}
                onMouseLeave={(e) => (e.target.style.backgroundColor = "")}
              >
                {item.label}
              </Link>
            </li>
          ))}
        </ul>
      </div>

      {/* Main Content */}
      <div className="flex-grow-1 p-3">
        <header style={styles.header}>
          <h1>Welcome to AQUAMOTUS - Admin Dashboard</h1>
        </header>
        <div className="row g-4">
          {[
            { title: "Boat", text: "Manage Boat Details", to: "/boat" },
            { title: "Event", text: "Manage Events", to: "/event" },
            { title: "Settings", text: "Manage Station Master Details", to: "/settings" },
          ].map((card, index) => (
            <div className="col-md-4" key={index}>
              <div
                className="card text-center"
                style={styles.card}
                onMouseEnter={(e) =>
                  Object.assign(e.currentTarget.style, styles.cardHover)
                }
                onMouseLeave={(e) =>
                  Object.assign(e.currentTarget.style, {
                    transform: "",
                    boxShadow: "",
                  })
                }
              >
                <div className="card-body">
                  <h5 className="card-title">{card.title}</h5>
                  <p className="card-text">{card.text}</p>
                  <Link
                    to={card.to}
                    className="btn btn-primary"
                    style={styles.cardLink}
                    onMouseEnter={(e) => (e.target.style.backgroundColor = "#0056b3")}
                    onMouseLeave={(e) =>
                      (e.target.style.backgroundColor = "#007BFF")
                    }
                  >
                    More info &#8594;
                  </Link>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
